import logo from './logo.svg';
import './App.css';


function App() {
  const styles = { 
    position: "absolute",
    width: "1536px",
    height: "64px",
    left: "0px",
    top: "0px",
    backgroundColor: "#F2EDED",
  }
  const btn = {
    position: "absolute",
    width: "85px",
    height: "39px",

    top: "10px",

    background: "rgba(255, 255, 255, 0.2)",
    borderRadius: "35.5px",
    margin: "auto",

  }
  const cont1={
    position: "absolute",
    width: "70px",
    height: "25px",
    left: "calc(50% - 70px/2 - 562px)",
    top: "calc(50% - 25px/2 - 3412px)",

    fontFamily: "Avenir",
    fontStyle: "normal",
    fontWeight: "500",
    fontSize: "18px",
    lineHeight: "25px",
    /* identical to box height */

    display: "flex",
    // alignItems: "center",
    letterSpacing: "0.04em",

    color: "#7090B0",
  }
  // const cont ={
  //   position: absolute;
  //   width: 70px;
  //   height: 25px;
  //   left: calc(50% - 70px/2 - 562px);
  //   top: calc(50% - 25px/2 - 3412px);

  //   font-family: 'Avenir';
  //   font-style: normal;
  //   font-weight: 500;
  //   font-size: 18px;
  //   line-height: 25px;
  //   /* identical to box height */

  //   display: flex;
  //   align-items: center;
  //   letter-spacing: 0.04em;

  //   color: #7090B0;
  // }
  return (
    <div className="App">
      <div style={styles}>
        <header>
          <nav>
            <a href='#' style = {cont1}> Contact </a>
            <button style ={btn}>Login</button>
            <a href='#'> Profile </a>
          </nav>
        </header>
      </div>
    </div>
  );
}

export default App;
